@namrata-ibm `gen_array_ops.rank()` is a generated wrapper for the `Rank` operator, which is defined at https://github.com/tensorflow/tensorflow/blob/master/tensorflow/core/ops/array_ops.cc?utf8=%E2%9C%93#L2191-L2212 .
The kernel associated with that operator is defined at https://github.com/tensorflow/tensorflow/blob/master/tensorflow/core/kernels/shape_ops.h#L85-L98 .
The code that puts in place the mapping between kernel and operator is at https://github.com/tensorflow/tensorflow/blob/master/tensorflow/core/kernels/shape_ops.cc#L193-L248 .
